svg.script:
/* Time (frame) */
var time  = 0;     /* Time in seconds */

/* SATURN layers */
var nlayers = 6;   /* Number of layers */
var layer = new Array( nlayers );

/* Saturn's rings */
var nrings = 3;    /* Number of rings */
var ring_front = new Array( nrings );
var ring_back  = new Array( nrings );
var angle = 90;    /* Angle of rings with respect to Saturn */
var ring_width  = new Array( 50, 60, 70 );
var ring_height = new Array( 10, 12, 14 ); /* 1/5 of width */

/* ENTER neon tube */
var enter;

function Start(evt) {

  layer[ 0 ]  = evt.target.ownerDocument.getElementById("Saturn1");
  layer[ 1 ]  = evt.target.ownerDocument.getElementById("Saturn2");
  layer[ 2 ]  = evt.target.ownerDocument.getElementById("Saturn3");
  layer[ 3 ]  = evt.target.ownerDocument.getElementById("Saturn4");
  layer[ 4 ]  = evt.target.ownerDocument.getElementById("Saturn5");
  layer[ 5 ]  = evt.target.ownerDocument.getElementById("Saturn6");

  enter       = evt.target.ownerDocument.getElementById("Enter-Text");

  ring_front[ 0 ] = evt.target.ownerDocument.getElementById("Ring1-Front");
  ring_front[ 1 ] = evt.target.ownerDocument.getElementById("Ring2-Front");
  ring_front[ 2 ] = evt.target.ownerDocument.getElementById("Ring3-Front");

  ring_back[ 0 ] = evt.target.ownerDocument.getElementById("Ring1-Back");
  ring_back[ 1 ] = evt.target.ownerDocument.getElementById("Ring2-Back");
  ring_back[ 2 ] = evt.target.ownerDocument.getElementById("Ring3-Back");

  Run();

}

function Run() {

  /* SATURN Text */

  /* Select only one 'layer', turn off others. */
  var t = Math.floor( time );
  for( var i = 0; i < nlayers; ++i ) {
    if( i == t-1 ) {
      layer[i].setAttribute( "style", "opacity:1" );
    } else {
      layer[i].setAttribute( "style", "opacity:0" );
    }
  }
  /* Flash all letters */
  if( t == 7 || t == 9 )
    layer[ nlayers-1 ].setAttribute( "style", "opacity:1" );


  /* Animate Saturn's rings */

  /*
   * Rotation is composed of two parts:
   *  Changing the y radius of the ellipses.
   *  Changing the incline angle of the ellipses.
   */

  /* Update angle */
  angle += 3; /* Rotate rings */
  if( angle > 360 ) angle = 0;

  var angle_radians = angle * 3.141592653/180.0;

  /* Change incline */
  var incline = 10 * Math.cos( angle_radians );
  var transform = "rotate(" +incline+ ")" ;

  for( var i = 0; i < nrings; ++i ) {

    /* Change incline */
    ring_front[ i ].setAttribute( "transform", transform );
    ring_back[  i ].setAttribute( "transform", transform );

    /* Change y radius */
    var height = ring_height[i] * Math.sin( angle_radians );
    /* This little do da is necessary as an arc must have a positive radius. */
    var df = 1;
    var db = 0;
    if( height < 0 ) {
      height = - height;
      df = 0;
      db = 1;
    }
    var path_front = "M " + ring_width[i] +", 0 A " +
                ring_width[i] + "," + height + " 0 1 " +
                df + " " +
                -ring_width[i] + ", 0" ;
    var path_back  = "M " + ring_width[i] +", 0 A " +
                ring_width[i] + "," + height + " 0 1 " +
                db + " " +
                -ring_width[i] + ", 0" ;

    ring_front[ i ].setAttribute( "d", path_front ); 
    ring_back[  i ].setAttribute( "d", path_back  ); 
  }


  /* Create flakey ENTER sign by randomly changing opacity */
  var enter_opacity = Math.round( 10.0 * Math.random() )/10.0;
  if( enter_opacity < 0.2 ) enter_opacity = 0.2; /* Minimum glow */
  enter.setAttribute( "style", "opacity:" +enter_opacity );


  time += 0.2;
  if( time >= 10 ) time = 0.0; /* Reset every 10 seconds */

  setTimeout("Run()", 200)


}
